import React, { Component } from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import Main from './components/Main';
import Nav from './components/Nav';

class App extends Component{
  render(){
      return (
        <Router>
    <div className="App">
      <Nav/>
      <Main/>
    </div>
    </Router>
  );
}

}


export default App;
